(2, 2, 1, '', '<p style=\"text-align: center;\"><strong>ARCANE</strong></p>\r\n<p><strong>Arcane</strong> merupakan perusahaan yang bergerak di bidang jasa kreatif meliputi : fotografi, videografi, multimedia, event organizer dan training center. Sudah berkarya sejak tahun 2009,&nbsp;arcane didukung oleh team yang kreatif, inovatif dan berjiwa muda. &nbsp;Dalam menjalankan pekerjaan kreatif ini, arcane tidak semata-mata untuk mencari keuntungan, tapi didasari oleh hobi, pengalaman yang telah dilakukan dan rasa cinta pada pekerjaan. Sehingga, karya kreatif yang dikerjakan akan menjadi karya terbaik yang diberikan untuk kepuasan klien.</p>\r\n<p>Menjadikan arcane sebagai penyedia jasa kreatif dalam bidang fotografi, videografi, event organizer dan training center yang memberikan pelayanan secara profesional dan penuh rasa tanggung jawab pada kepuasan pelanggan, mampu mewujudkan harapan pendiri perusahaan dan karyawan, serta bisa memberikan manfaat bagi masyarakat.</p>\r\n<ol>\r\n<li>Membangun tim kerja yang kreatif dan inovatif dalam lingkungan kerja yang profesional dan menyenangkan untuk bekerja.</li>\r\n<li>Membangun jaringan dan sinergi yang saling menguntungkan dengan klien dan partner kerja.</li>\r\n<li>Menerapkan pola bisnis yang menjunjung tinggi nilai spiritual berdasarkan norma yang ada dalam masyarakat serta berorientasi sosial agar bermanfaat untuk sesama.</li>\r\n</ol>\r\n<p><em><strong>&ldquo;We Remember Moments&rdquo;</strong> </em>adalah jargon kami. Kami ingin setiap moment bersama kami akan menjadi hal yang baik, indah, bermanfaat, serta memorable (akan selalu diingat).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>JASA KREATIF&nbsp;</strong></p>\r\n<p><strong>:: PHOTO STUDIO</strong></p>\r\n<p>Di bidang fotografi,&nbsp;Arcane melayani pas foto, foto wisuda, foto gaya, foto keluarga, foto pre-wedding, foto event, maupun foto product.&nbsp;Pemotretan di studio&nbsp;Arcane menggunakan teknik \"tethering\" dimana hasil pemotretan bisa langsung dilihat di layar monitor yang tersedia, sehingga bisa dilakukan koreksi dan evaluasi dalam pemotretan selanjutnya</p>\r\n<p><strong>::&nbsp;VIDEO &amp; MULTIMEDIA</strong></p>\r\n<p>InFocus Creativa melayani pekerjaan kreatif di bidang video dan multimedia, antara lain : video company profile, video dokumentasi (single cam/multicam), television video commercial (TVC), bumper, infographic, LED Screen, serta FOH Multimedia System.<br /><br /><strong>:: EVENT ORGANIZER</strong></p>\r\n<p>Event Organizer menjadi salah satu bidang garapan Arcane, di mana pekerjaan yang ditangani, antara lain : manajemen event, sound system &amp; lighting, stage &amp; decoration, stand/booth, serta supporting event.</p>\r\n<p><strong>:: TRAINING CENTER</strong></p>\r\n<p>Pengalaman di dunia photography, video dan multimedia, event organizer menjadi dorongan untuk berbagi ilmu dan sharing pengalaman dalam beberapa pelatihan yang diadakan untuk anak-anak, remaja dan umum, antara lain meliputi : workshop managemen event dan protokoler, master of ceremony (MC), public speaking, announcer radio dan tv, serta produksi video/film.</p>\r\n<p>&nbsp;</p>', 't'),
